import logo from './logo.svg';
import './App.css';
import Pokemon from './Pokemon';
import pokemons from './data';

function App() {
  return (
    pokemons.map((pokemon, index) => 
    <div key={index}>
      <Pokemon 
      name={pokemon.name} 
      type={pokemon.type} 
      averageWeight={pokemon.averageWeight}
      image={pokemon.image}
      index={index}/>)
    </div> 
    )
  )
}

export default App;
